#Given a string S, consider all duplicated substrings: (contiguous) substrings of S that occur 2 or more times.  (The occurrences may overlap.)

#Return any duplicated substring that has the longest possible length.  (If S does not have a duplicated substring, the answer is "".)
#using hash() function makes time limit error
#using a regular set makes memory limit error
# the only option is to use the Rabin-Karp hash

#solution:
#using a binary search we start to looking for duplicate substrings
# the first try we we look for substring with length half of the entire string
# if there is something duplicate, then we only look for duplicates with length more than c
# if there is no duplicate we start looking for duplicates with lengths less than c
# how to search for duplicates with len c: use Rabin-karp hash
# compute hash for the substring with length c, and then start adding chars from the right side and removing chars from the left sides
class Solution(object):
    def search(self, c, s):#find if there is a duplicate with length c
        seen = set()
        q=2**60-1
        d=26
        h=pow(d,c)%q
        hash=0
        i=c
        for j in range(c):
            hash=(d*hash+ord(s[j]))%q
        if(hash not in seen):
            seen.add(hash)
        for i in range(c,len(s)):
            hash=(d*hash-ord(s[i-c])*h+ord(s[i]))%q
            if (hash not in seen):
                seen.add(hash)
            else:
                return s[i - c+1: i+1 ]
        return ""

    def longestDupSubstring(self, S):
        """
        :type S: str
        :rtype: str
        """
        l = 0
        r = len(S)
        o = ""
        while ( l <= r):
            c = l + ((r - l) / 2)
            f = self.search(c, S)
            if (len(f) == 0):
                r = c - 1
            else:
                l = c + 1
                o = f
        return o
s=Solution()
